import React from 'react';
import Link from 'next/link'
import Route from 'next/router'

const HomePage = () => {
    return (
        <div>
            This is home page 2
            <Link href="/auth">Auth</Link>
            <button onClick={()=> Route.push("/auth")}>Auth Route</button>
            <div className="my-div">
                inside div
            </div>

            <style jsx> {`
                .my-div {
                    color: red;
                }
            `}
            </style>
        </div>
    );
};

export default HomePage;
